GONE BUT NOT FORGOTTEN is a tender gay love story that blends equal parts mystery and romance. Drew Parker (Aaron Orr) is a lonely small-town forest ranger whose life is transformed when he meets a stranded, injured hiker suffering from amnesia. Mark (Matthew Montgomery) has no memory of who he is or how he got there, and as he begins to recover the pieces of his former life, he and Drew form a close friendship that grows into love--one that is threatened when Mark&amp;#039;s past comes back to haunt him.


